(function(){
  var imp, A, B, fa, a, b;
  imp = new (require('../lib/imp'));
  A = (function(){
    A.displayName = 'A';
    var prototype = A.prototype, constructor = A;
    function A(name){
      this.name = name;
    }
    return A;
  }());
  B = (function(){
    B.displayName = 'B';
    var prototype = B.prototype, constructor = B;
    function B(name, birthday){
      this.name = name;
      this.birthday = birthday;
    }
    return B;
  }());
  imp.def(A, String, JSON.stringify);
  imp.def(B, String, JSON.stringify);
  fa = imp.wrap(String, String)(function(a, b){
    console.log("a: " + a);
    console.log("b: " + b);
  });
  a = new A('Alice');
  b = new B('Bob', '1970-01-01');
  fa(a, b);
}).call(this);
